import React from "react";
import { IoIosNotifications, IoIosSettings } from "react-icons/io";

export default function Nav() {
    return <>
    
        <div class="navbar bg-dark pb-3">
        <IoIosNotifications className="icon"/>
        <IoIosSettings  className="icon"/>
        </div>
    
    </>
}
